//import { createStackNavigator } from '@react-navigation/stack';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as React from 'react';

import { Image, Text, View, ScrollView, Pressable } from 'react-native';
import { SafeAreaView } from "react-native-safe-area-context";
import { imageIndex } from '../constants/images';

// Import helper code
import Settings from '../constants/Settings';

// Import styling and components

import { MyButton } from '../components/MyButton';
import { TextH1, TextParagraph } from "../components/StyledText";

// Import navigation and screens
import ViewPeopleScreen from '../screens/ViewPeopleScreen';

// Import styling and components
import Styles from "../styles/MainStyle";

//const Stack = createStackNavigator();
const Stack = createNativeStackNavigator();
const [isLogoColor, setIslogoColor] = React.useState(true);
function toggleLogo() {
    setIslogoColor(!isLogoColor);
    //console.log('345345');
  }
export default function PeopleNavigator() {
  return (
    <Stack.Navigator 
      initialRouteName="ViewPeople"
      screenOptions={{
        headerShown: true,
        headerBackTitle: "Back",
        headerStyle: Styles.headerBar,
        headerTitleStyle: Styles.headerBarTitle,
      }}>
      <Stack.Screen
        name="ViewPeople"
        component={ViewPeopleScreen}
        options={{ title: 'View All Staff' }} />
          





        <Image source={imageIndex[isLogoColor ? 'logo' : 'mono']} style={Styles.homeLogo}/>
    </Stack.Navigator>
  );
}
